import {FaSearch} from 'react-icons/fa'
const Search = () => {
    return (
        <header>
            <h2 className="header__title">Search it. Explore it. Buy it.</h2>
            <FaSearch className='' />
            <input className="header__search" placeholder="Enter an address, neighborhood, city, or ZIP code"/>
        </header>
    );
}

export default Search;
